import Social from './social';
import LatestPost from './latestPosts';
import QuickLinks from './quicklinks';

function Footer() {
  return (
    <>
      <footer className="bg-black tColor">
        <div class="row">
            <div class="col-lg-4 pt">
              <QuickLinks/>
            </div>
            <div class="col-lg-4 pt-4">
               <Social/> 
            </div>
            <div class="col-lg-4 pt-4">
              <LatestPost/>
            </div>
          </div>
      </footer>
    </>
  );
}

export default Footer;
